/**
 * @author Ahmed Rafsan Raqib
 * This is the main module where the Application is initiated.
 */
import "./App.css";
import DriverSearchForm from "./Components/DriverSearchForm";
import React from "react";
import ApplicationFooter from "./Components/ApplicationFooter";
import ListDrivers from "./Components/ListDrivers";
import { Routes, Route } from "react-router-dom";

function App() {
  const sendEmailToDrivers = (DriverId) => {};
  return (
    <div className="container">
      <div className="App">
        <Routes>
          <Route path="/" element={<DriverSearchForm />} exact />
          <Route
            path="/listDrivers"
            element={<ListDrivers initiateClickEvent={sendEmailToDrivers} />}
          />
          <Route component={Error}></Route>
        </Routes>
      </div>

      <div>
        <ApplicationFooter />
      </div>
    </div>
  );
}

export default App;
